  constructor(props) {
    super() // would pass in props here if I needed this.props in constructor
  }

  render() {
    return (
      <h1 id='title-bar'>{this.props.textProp}</h1>
    );
  }
}

Title.defaultProps = {
   textProp: 'Cyberpunk RPG Character Sheet',
}
